import React from 'react';
import './Header.css';

export default function Header() {
    return (
        <nav>
            <ul>
                <li><a className="page-title" href="/">ToDo App</a></li>
                <li><a href="/">Home</a></li>
                <li><a href="/about">About</a></li>
            </ul>
        </nav>
    )
}
